import {
  KanbanComponent,
  ColumnsDirective,
  ColumnDirective,
} from "@syncfusion/ej2-react-kanban";

import { kanbanData, kanbanGrid } from "../data/kanbanData";

const Kanban = () => {
  return;
  <KanbanComponent>
    <ColumnsDirective>
      {kanbanGrid.map((item, index) => (
        <ColumnDirective />
      ))}
    </ColumnsDirective>
  </KanbanComponent>;
};

export default Kanban;
